import React, { Component } from 'react'
import '../App.css'
import { Link } from 'react-router-dom'

class Nav extends Component {
  render() {
    return (
      <div>
        <nav>
          <Link
            style={{ color: 'rgb(255, 127, 80)', textDecoration: 'none' }}
            to="/"
          >
            <h1>Count Up</h1>
          </Link>
          <Link
            style={{ color: 'rgb(255, 127, 80)', textDecoration: 'none' }}
            to="/profile"
          >
            <h1>Profile</h1>
          </Link>
        </nav>
      </div>
    )
  }
}

export default Nav
